export enum IS_AVAILABLE {
  /**
   * 无效
   */
  INVALID = 0,
  /**
   * 有效
   */
  VALID = 1
}

export enum SHOP_SETTING {
  /**
   * 全店
   */
  ALL_STORE = 1,
  /**
   * 指定门店
   */
  SPECIFIED_STORE = 2
}

export enum TIME_UNIT {
  /**
   * 今天
   */
  TIME_TODAY = 1,
  /**
   * 周
   */
  TIME_WEEK = 2,
  /**
   * 日
   */
  TIME_DAY = 3,
  /**
   * 月
   */
  TIME_MONTH = 4
}

export enum RESERVE_LIMIT_TYPE {
  /**
   * 无限制
   */
  NOT_LIMIT = 0,
  /**
   * 日期
   */
  DATE = 1,
  /**
   * 小时
   */
  TIME = 2
}
